			and calling =#{pager.m.calling}



			and capUrl =#{pager.f.capUrl}


			and videoUrl =#{pager.f.videoUrl}

	 order by frameTime asc 

		LIMIT #{pager.beginCount},#{pager.pageRows}
	)

